import ThemeToggle from "../ThemeToggle/ThemeToggle";
import "./Sidebar.css";
import SidebarButton from "../SidebarButton/SidebarButton";

const Sidebar = () => {
  const generalLinks = [
    { name: "Dashboard", icon: "üè†" },
    { name: "Anunturi", icon: "üì¢" },
    { name: "Harta", icon: "üó∫Ô∏è" },
    { name: "Cursuri", icon: "üìö" },
    { name: "Catalog", icon: "üìò" },
    { name: "Orar", icon: "üïí" },
    { name: "Chat", icon: "üí¨" },
  ];

  const managementLinks = [
    { name: "Contul", icon: "üë§" },
    { name: "Contact", icon: "üìß" },
  ];

  return (
    <aside className="sidebar">
      <div className="sidebar-top">
        <div className="logo">
          FII<span>Connect</span>
        </div>

        <div className="section">GENERAL</div>
        <ul className="nav-list">
          {generalLinks.map((link, index) => (
            <SidebarButton
              key={index}
              icon={link.icon}
              label={link.name}
              to={`/app/${link.name.toLowerCase()}`}
            />
          ))}
        </ul>

        <div className="section">MANAGEMENT</div>
        <ul className="nav-list">
          {managementLinks.map((link, index) => (
            <SidebarButton
              key={index}
              icon={link.icon}
              label={link.name}
              to={`/app/${link.name.toLowerCase()}`}
            />
          ))}
        </ul>
      </div>

      <div className="sidebar-bottom">
        <p className="footer">2025 ¬© FIIConnect</p>
        <ThemeToggle />
      </div>
    </aside>
  );
};

export default Sidebar;
